import React, {Component} from "react"
import {isSafari} from 'react-device-detect';

class DetectSafari extends Component (props){

    render(props) {

        alert("Safari detected!")

        if (isSafari) return 
        <p>{props.count > 0 && "If it didn't work on the last click, try clicking the above button one more time"}</p>
        return (
            <div>nothing</div>
        )
    }

}

export default DetectSafari
